create table IF NOT EXISTS management_day (start_time TIME,end_time TIME,break_time TIME,sum1 TIME,ses_time TIME,dispatch_time TIME,entrusted_time TIME,in_busi_time TIME,sum2 TIME,remarks1 char,remarks2 char,remarks char,management_time DATE NOT NULL,insert_day TIMESTAMP,insert_year_month CHAR NOT NULL,user_id char NOT NULL,del_flg integer DEFAULT 0,PRIMARY KEY(management_time,insert_year_month,user_id));